import { Task } from './store';

export class TaskStore {
  constructor(private dataPath: string) {}

  private loadTasks(): Task[] {
    const fileContent = fs.readFileSync(this.dataPath, 'utf8');
    return JSON.parse(fileContent);
  }

  private saveTasks(tasks: Task[]): void {
    fs.writeFileSync(this.dataPath, JSON.stringify(tasks), { encoding: 'utf-8' });
  }

  list(): Task[] {
    const tasks = this.loadTasks();
    return tasks;
  }

  add(title: string): Task {
    const id = Date.now().toString(36) + Math.random().toString(36).slice(2);
    const createdAt = new Date().toISOString();
    const task: Task = { id, title, done: false, createdAt };
    this.saveTasks([...this.list(), task]);
    return task;
  }

  done(id: string): Task {
    const tasks = [...this.list()];
    const index = tasks.findIndex(task => task.id === id);
    if (index !== -1) {
      const updatedTask = { ...tasks[index], done: true };
      this.saveTasks([...tasks.slice(0, index), updatedTask, ...tasks.slice(index + 1)]);
      return updatedTask;
    }
    throw new Error('Task not found');
  }

  remove(id: string): void {
    const tasks = [...this.list()];
    const index = tasks.findIndex(task => task.id === id);
    if (index !== -1) {
      this.saveTasks([...tasks.slice(0, index), ...tasks.slice(index + 1)]);
    } else {
      throw new Error('Task not found');
    }
  }
}

export interface Task {
  id: string;
  title: string;
  done: boolean;
  createdAt: string;
